import React from 'react';
import './Badge.scss';

//TODO: a (re) diviser ?

export default function Badge(props) {
    return (
        <div id="badge">
            <div className="container">
                <div className="row" id="first-row-dashboard" id="badge--div">
                {/* <div id="badge--div" className="col"> */}
                    <div className="col" >
                        <h2 id="badge--title">Badge</h2>
                        {/*  Photo*/}
                        {/* src="/frontend/typescript-react-app/public/default_avatar.png" */}
                        <img src="https://miro.medium.com/max/720/1*W35QUSvGpcLuxPo3SRTH4w.png" alt="default" id="badge-picture"/>
                        {/* TODO: ajouter un bouton pour importer une photo ? */}
                        {/* Rank */}
                    </div>
                    {/* <div className="col"> */}
                        <div className="col">
                            <p id="badge--rank">Rank</p>
                            {/* Total Score */}
                            <p id="badge--total-score">Total score</p>
                            {/* Games */}
                            <p id="badge--games">Games</p>
                            {/* Achievements */}
                            <p id="badge--achievements">Achievements</p>
                        </div>
                    </div>
                    <div className="col" id="badge--wins">
                        <h2 id="wins-title">Wins</h2>
                        <br/>
                        {/* /?<div className="row"> */}
                            <p id="p--wins">6 wins</p>
                        {/* </div> */}
                    </div>
                    <div className="col" id="badge--graph">
                        <h2 id="graph-title">Graph</h2>
                        {/* TODO: voir pour le graph  */}
                    </div>
                </div>
            {/* </div> */}
            {/* </div> */}
        </div>
    )
}

// class Badge
